"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[5610],{15610:(e,i,r)=>{r.r(i),r.d(i,{default:()=>n});let n="## Utilisation d'un p\xe9riph\xe9rique WebUSB ou WebSerial :\nApr\xe8s avoir connect\xe9 un p\xe9riph\xe9rique WebUSB ou WebSerial, vous pouvez maintenant continuer vers la [Page Galerie](/gallery) ou la [Page d'Accueil](/).  \nLe symbole USB pulsera d\xe8s que des donn\xe9es seront re\xe7ues.    \nVous pouvez \xe9galement acc\xe9der \xe0 ces options via le symbole USB dans la navigation et la [Page Param\xe8tres](/settings).  \n\n## Note : WebUSB et Web Serial sont similaires mais pas identiques :\n* Bien que Web Serial ait acc\xe8s \xe0 un port COM standard et ne n\xe9cessite pas de p\xe9riph\xe9riques sp\xe9ciaux, cette fonctionnalit\xe9 n'est pas disponible sur les appareils mobiles.\n* WebUSB n\xe9cessite certains microcontr\xf4leurs o\xf9 le processeur a un acc\xe8s direct \xe0 l'interface USB (par ex. un Arduino Leonardo). Voir [webusb for arduino sur GitHub](https://github.com/webusb/arduino) pour plus d'informations.\n\n## Projets Support\xe9s\nCette application web de galerie supporte actuellement deux p\xe9riph\xe9riques s\xe9rie sp\xe9cifiques d\xe9di\xe9s \xe0 la GameBoy Camera : \n* R\xe9ception de donn\xe9es de tuiles et de paquets captur\xe9s imprim\xe9s depuis une GameBoy physique via l'[Arduino Gameboy Printer Emulator](https://github.com/mofosyne/arduino-gameboy-printer-emulator/) \n* Envoi de donn\xe9es de tuiles \xe0 imprimer sur une GameBoy Printer physique via l'[Interface Super Printer](https://github.com/Raphael-Boichot/Yet-another-PC-to-Game-Boy-Printer-interface/)\n\n## P\xe9riph\xe9riques Recommand\xe9s (microcontr\xf4leurs)\nLa plupart des Arduinos g\xe9n\xe9riques (par ex. \"Arduino Nano\") devraient fonctionner sans probl\xe8me si vous travaillez sur un PC de bureau.  \nPour pouvoir communiquer avec un p\xe9riph\xe9rique s\xe9rie sur les t\xe9l\xe9phones Android \xe9galement, il faut un p\xe9riph\xe9rique programm\xe9 avec WebUSB activ\xe9 (par ex. un \"Arduino Leonardo\" - alias \"Arduino Pro Micro\").  \nNi WebUSB ni WebSerial ne sont disponibles lorsque vous utilisez Firefox ou tout appareil iOS.\n"}}]);